import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Link,
    useQuery
  } from "react-router-dom";

class Resultados extends React.Component{

    render(){
        let query = useQuery();
        return(
            <div>
                <h1>Se muestran los resultados para la url</h1>
                <p>query.get</p>
            </div>
        )
    }
}

export default Resultados;
